import React from 'react'
import './categorie.css'
import Logos from './Assets/logos.jpg'
import {Card, CardImg, CardBody, CardTitle,CardSubtitle,Button,CardText } from 'reactstrap'


const CategrieAnnonce = props =>{
    return(
        <div>
            <card sty>
                <CardImg top width="20px"src={Logos} alt="card image cap"/>
                <CardTitle>borel</CardTitle>
                <CardText>
                    ifg,ipog
                </CardText>
            </card>
        </div>
    );
};

export default CategrieAnnonce;
